  Add1_add_cast <= '0' & '0' & '0' & '0' & '0' & '0' & '0' & Switch1_out1_6;
  Add1_out1 <= Delay3_out1_2 + Add1_add_cast;

  Constant_out1_3 <= to_unsigned(16#00#, 8);

  
  Switch1_out1_7 <= Add1_out1 WHEN Delay5_out1 = '0' ELSE
